import React, { useState } from "react";
import {
  View,
  Text,
  TextInput,
  TouchableOpacity,
  StyleSheet,
  Image,
  onPress,
} from "react-native";
import Icon from "react-native-vector-icons/FontAwesome";

const OrderScreen = ({ navigation }) => {
  const [showDetails, setShowDetails] = useState(false);

  const toggleDetails = () => {
    setShowDetails(!showDetails);
  };

  return (
    <View style={styles.container}>
      <View style={styles.header}>
        <TouchableOpacity onPress={() => navigation.goBack()}>
          <Icon name="bars" size={20} color="black" style={styles.bars} />
        </TouchableOpacity>
        <View style={styles.logoContainer}>
          <Image
            source={require("../img/logo.png")}
            style={styles.logoimage}
            accessible={true}
            accessibilityLabel={"logo"}
          />
        </View>
      </View>
      <TouchableOpacity style={styles.orderButton} onPress={toggleDetails}>
        <Text style={styles.orderNo}>Order No. 12345</Text>
        <View style={styles.orderDetails}>
          <Text style={styles.orderDate}>June 3, 2023</Text>
          <Icon
            name={showDetails ? "angle-up" : "angle-down"}
            size={20}
            color="black"
          />
        </View>
      </TouchableOpacity>
      {showDetails && (
        <View style={styles.orderDetailsContainer}>
          <View style={styles.orderDetail}>
            <Text style={styles.orderDetailLabel}>Item 1</Text>
            <Text style={styles.orderDetailValue}>$10.00</Text>
          </View>
          <View style={styles.orderDetail}>
            <Text style={styles.orderDetailLabel}>Item 2</Text>
            <Text style={styles.orderDetailValue}>$15.00</Text>
          </View>
          <View style={styles.orderDetail}>
            <Text style={styles.orderDetailLabel}>Item 3</Text>
            <Text style={styles.orderDetailValue}>$20.00</Text>
          </View>
          <View style={styles.orderTotal}>
            <Text style={styles.orderTotalLabel}>Total:</Text>
            <Text style={styles.orderTotalValue}>$45.00</Text>
          </View>
        </View>
      )}
      <View style={styles.footer}>
        <TouchableOpacity style={styles.footerText}>
          <Icon name="home" size={20} color="black" />
        </TouchableOpacity>
        <TouchableOpacity style={styles.footerText}>
          <Icon name="heart" size={20} color="black" />
        </TouchableOpacity>
        <TouchableOpacity style={styles.footerText}>
          <Icon name="shopping-cart" size={20} color="black" />
        </TouchableOpacity>
        <TouchableOpacity style={styles.footerText}>
          <Icon name="user" size={20} color="black" />
        </TouchableOpacity>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#F2F2F2",
    width: 390,
    height: 844,
  },
  header: {
    height: 74,
    flexDirection: "row",
    backgroundColor: "white",
    justifyContent: "center",
    alignItems: "center",
    paddingHorizontal: 10,
  },
  bars: {
    marginRight: "auto",
  },
  logoContainer: {
    alignItems: "center",
    width: "50%",
  },
  logoimage: {
    width: 208,
    height: 41,
  },
  orderButton: {
    flexDirection: "row",
    justifyContent: "space-between",
    alignItems: "center",
    backgroundColor: "white",
    paddingVertical: 10,
    paddingHorizontal: 20,
    marginTop: 20,
  },
  orderNo: {
    fontWeight: "bold",
    fontSize: 16,
    letterSpacing: 2,
  },
  orderDetails: {
    flexDirection: "row",
    alignItems: "center",
  },
  orderDate: {
    marginRight: 10,
    fontSize: 14,
  },
  orderDetailsContainer: {
    backgroundColor: "white",
    paddingHorizontal: 20,
    paddingVertical: 10,
    borderTopWidth: 1,
    borderBottomWidth: 1,
    borderColor: "#ddd",
  },
  orderDetail: {
    flexDirection: "row",
    justifyContent: "space-between",
    marginBottom: 10,
  },
  orderDetailLabel: {
    fontSize: 14,
  },
  orderDetailValue: {
    fontWeight: "bold",
    fontSize: 14,
  },
  orderTotal: {
    flexDirection: "row",
    justifyContent: "space-between",
    marginTop: 10,
  },
  orderTotalLabel: {
    fontWeight: "bold",
    fontSize: 16,
  },
  orderTotalValue: {
    fontWeight: "bold",
    fontSize: 16,
  },
  footer: {
    height: 74,
    backgroundColor: "white",
    alignItems: "center",
    justifyContent: "center",
    paddingHorizontal: 10,
    position: "absolute",
    bottom: 0,
    left: 0,
    right: 0,
  },
  footerText: {
    marginHorizontal: 40,
  },
});

export default OrderScreen;
